import { Col, Container, Row, Table } from "react-bootstrap";

const Fixtures = () => {
  return (
    <Container fluid>
      <Table striped bordered hover variant="secondary">
        <tbody>
          <Row>
            <Col>
              <tr className="w-100">
                <td className="w-50">Mark</td>
                <td className="w-150">Otto</td>
              </tr>
            </Col>
            <Col>
              <tr>
                <td>Mark</td>
                <td>Otto</td>
              </tr>
            </Col>
          </Row>
        </tbody>
      </Table>
    </Container>
  );
};
export default Fixtures;
